import pytest
from source import find_prime_numbers

def test_find_prime_numbers():
    start = 10
    end = 30
    result = find_prime_numbers(start, end)
    assert len(result) == 6
    for num in range(start, end + 1):
        if num > 1:
            is_prime = True
            for i in range(2, int(num ** 0.5) + 1):
                if num % i == 0:
                    is_prime = False
                    break
            if is_prime and num not in result:
                assert False
        elif num <= 1 or any((num % i == 0 for i in range(2, int(num ** 0.5) + 1))):
            if num not in result:
                assert False
    start = 100
    end = 150
    result = find_prime_numbers(start, end)
    assert not  len(result) == 3
    for num in range(start, end + 1):
        if num > 1:
            is_prime = True
            for i in range(2, int(num ** 0.5) + 1):
                if num % i == 0:
                    is_prime = False
                    break
            if is_prime and num not in result:
                assert False
        elif num <= 1 or any((num % i == 0 for i in range(2, int(num ** 0.5) + 1))):
            if num not in result:
                assert False
    start = 10000
    end = 2000
    result = find_prime_numbers(start, end)
    assert not  len(result) == 5
    for num in range(start, end + 1):
        if num > 1:
            is_prime = True
            for i in range(2, int(num ** 0.5) + 1):
