                    is_prime = False
                    break
            if is_prime and num not in result:
                assert False
        elif num <= 1 or any((num % i == 0 for i in range(2, int(num ** 0.5) + 1))):
            if num not in result:
                assert False
    start = 100000
    end = 30000
    result = find_prime_numbers(start, end)
    assert not  len(result) == 12
