def insert_element_in_mode(original_list, new_element, N):
    if N <= 0 or N > len(original_list):
        raise ValueError('Invalid N value')
    else:
        return original_list[:N] + [new_element] + original_list[N:]

def max_frequency_insert(original_list, insert_value, pos):
    if pos > len(original_list):
        raise IndexError("Index is greater than the length of the list")
    else:
        new_list = original_list.copy()
        new_list.insert(pos, insert_value)
        return new_list

