def calculate_minutes(start: str, end: str):
    start_time = datetime.strptime(start, '%Y-%m-%d %H:%M:%S')
    end_time = datetime.strptime(end, '%Y-%m-%d %H:%M:%S')
    return (end_time - start_time).total_seconds() / 60

