    primes = [True for i in range(n+1)]
    p = 2
    while(p * p <= n):
        if (primes[p] == True):
            for i in range(p * p, n+1, p):
                primes[i] = False
        p += 1
    primes[0]= False
    primes[1]= False
    return [p for p in range(n+1) if primes[p]]

def factorialDivisors(n):
    factorial = 1
    for i in range(1, n+1):
        factorial *= i
    divisors = []
    for i in range(factorial):
        if factorial % i == 0:
            divisors.append(i)
